import React, { Component } from "react";
import axios from "axios";

export default class Project extends Component {
  state = {
    project: {},
    isLoaded: false,
  };

  componentDidMount() {
    axios
      .get(`/wp-json/wp/v2/project?slug=${this.props.match.params.slug}`)
      .then((res) =>
        this.setState({
          project: res.data[0],
          isLoaded: true,
        })
      )
      .catch((err) => console.log(err));
  }

  render() {
